import { authHeader, handleResponse } from "../_helpers";

const target = `https://intim-vibe-api.padilo.pro/api`;

export const adminService = {
	registration
};

function registration(name, password, email, password_confirmation) {
	const requestOptions = { 
    method: "POST", 
    headers: authHeader()
  };
  
  return fetch(`${target}/admin/register`, requestOptions).then(handleResponse);
}
